import React from 'react';
import Button from '../Button';
import Input  from '../Input';
import style from './Welcome.module.css';

const Login = ({}) => {
    return <div>
        <p>Welcome Back</p>
        <div>
            <Button></Button>
        </div>
        <p>or</p>
        <p>EMAIL</p>
        <div>
            <Input></Input>
        </div>
        <p>PASSWORD</p>
        
        <div>
            <Input></Input>
        </div>
    </div>
}

export default Login;
